import React, { Component } from 'react';
import { Link } from 'react-router-dom';

class Make extends Component {



  render() {
    const { make } = this.props
    return (
      <Link to={`/${make}/selectModel`} >
        <div className="button-div">
          <li onClick={this.handleMake}>{make}</li>
        </div>
      </Link>
    );
  }

}

export default Make;
